<div class="Parallax GParallax1"><div class="Img Binary"><div class="Caption"><a href="#"><div class="Text">Programmation web en HTML<br></div></a></div></div><div class="Body2 Orange"><br>Le but de ce tutoriel est de vous apprendre la programmation web en <b>HTML</b>.<br>Produit par <b>Gérard KESSE</b>.<br><br><div class="Content0 GSummary1"><div class="Body0" id="Loader_1529412976174"><div class="Row26">Summary 1</div></div><script>loadSummary1("Loader_1529412976174");</script></div><br></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Introduction"><a class="Link3" href="#">Introduction</a></h1><div class="Body3"><br><b>HTML </b>est le langage de balisage standard pour les documents conçus pour être affichés dans un navigateur Web. Il peut être assisté par des technologies telles que les feuilles de style en cascade (CSS) et des langages de script tels que JavaScript. Les navigateurs Web reçoivent des documents HTML d'un serveur Web ou d'un stockage local et restituent les documents dans des pages Web multimédias. HTML décrit sémantiquement la structure d'une page Web et incluait à l'origine des indices pour l'apparence du document. Les éléments HTML sont les blocs de construction des pages HTML. Avec les constructions HTML, des images et d'autres objets tels que des formulaires interactifs peuvent être intégrés dans la page rendue. HTML fournit un moyen de créer des documents structurés en désignant la sémantique structurelle du texte, comme les titres, les paragraphes, les listes, les liens , les citations et d'autres éléments. Les éléments HTML sont délimités par des balises , écrites à l' aide de chevrons .<br><br><div class="Img3 GImage"><img id="img_1646115991430" alt="img_1646115991430" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Rendre-un-element-div-editable"><a class="Link3" href="#">Rendre un élément div éditable</a></h1><div class="Body3"><br>Rendre un élément div éditable.<br><br><div class="Content0 GSummary2"><div class="Row26">Summary 2</div></div><br><h2 class="Title7 GTitle2" id="Rendre-un-element-div-editable-Activer-l-edition"><a class="Link9" href="#Rendre-un-element-div-editable">Activer l'édition</a></h2><br><div class="Img3 GImage"><img id="img_1645988911530" alt="img_1645988911530" src="data:image/png;base64,"></div><br>En HTML, tout élément peut être modifiable. En utilisant certains gestionnaires d'événements JavaScript, vous pouvez transformer votre page Web en un éditeur de texte enrichi complet et rapide. Tout ce que vous avez à faire est de définir l'attribut <b>contenteditable </b>sur presque tous les éléments HTML pour le rendre modifiable.<br><br><h2 class="Title7 GTitle2" id="Rendre-un-element-div-editable-Editer-le-contenu-web"><a class="Link9" href="#Rendre-un-element-div-editable">Éditer le contenu web</a></h2><br><div class="Img3 GImage"><img id="img_1645989630862" alt="img_1645989630862" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Rendre-un-element-div-editable-Appliquer-une-transformation"><a class="Link9" href="#Rendre-un-element-div-editable">Appliquer une transformation</a></h2><br><div class="Content0 GSummary3"><div class="Row26">Summary 3</div></div><br><h3 class="GTitle3" id="Rendre-un-element-div-editable-Ajouter-du-style-Definir-un-gestionnaire-d-evenement"><a class="Title8" href="#Rendre-un-element-div-editable-Ajouter-du-style">Définir un gestionnaire d'évènement</a></h3><br><div class="Img3 GImage"><img id="img_1645990115044" alt="img_1645990115044" src="data:image/png;base64,"></div><br>La propriété <b>onclick </b>est le gestionnaire d'événements pour le traitement des événements click sur un élément donné. La commande <b>bold</b> active/désactive le gras pour la sélection ou au point d'insertion. Internet Explorer utilise la balise <b>&lt;strong&gt;</b> au lieu de <b>&lt;b&gt;</b>.<br><br><h3 class="GTitle3" id="Rendre-un-element-div-editable-Appliquer-une-transformation-Appliquer-la-transformation"><a class="Title8" href="#Rendre-un-element-div-editable-Appliquer-une-transformation">Appliquer la transformation</a></h3><br><div class="Img3 GImage"><img id="img_1645990625433" alt="img_1645990625433" src="data:image/png;base64,"></div><br>La méthode <b>execCommand </b>permet d'exécuter des commandes qui manipulent la région modifiable actuelle, telles que des <b>entrées de formulaire</b> ou des éléments <b>contentEditable</b>. La plupart des commandes affectent la sélection du document (gras, italique, etc.), tandis que d'autres insèrent de nouveaux éléments (ajout d'un lien), ou affectent une ligne entière (indentation). Lors de l'utilisation de <b>contentEditable</b>, la méthode <b>execCommand </b>affecte l'élément modifiable actuellement actif.<br><br><h2 class="Title7 GTitle2" id="Rendre-un-element-div-editable-Inserer-un-contenu-HTML"><a class="Link9" href="#Rendre-un-element-div-editable">Insérer un contenu HTML</a></h2><br><div class="Content0 GSummary3"><div class="Row26">Summary 3</div></div><br><h3 class="GTitle3" id="Rendre-un-element-div-editable-Inserer-un-contenu-HTML-Definir-le-contenu-HTML"><a class="Title8" href="#Rendre-un-element-div-editable-Inserer-un-contenu-HTML">Définir le contenu HTML</a></h3><br><div class="Img3 GImage"><img id="img_1645992530871" alt="img_1645992530871" src="data:image/png;base64,"><br><br></div><h3 class="GTitle3" id="Rendre-un-element-div-editable-Inserer-un-contenu-HTML-Inserer-le-contenu-HTML"><a class="Title8" href="#Rendre-un-element-div-editable-Inserer-un-contenu-HTML">Insérer le contenu HTML</a></h3><br><div class="Img3 GImage"><img id="img_1645992563619" alt="img_1645992563619" src="data:image/png;base64,"></div><br>La commande <b>insertHTML </b>insère une chaîne HTML au point d'insertion (supprime la sélection). Nécessite une chaîne HTML valide comme argument de valeur. (Non pris en charge par Internet Explorer.)<br><br></div></div></div></div><br>